function animalsGridInit() {
	const blocks = document.querySelectorAll(".odin-animals-grid");

	if (!blocks) {
		return;
	}

	[...blocks].map((block) => {
		const id = block.getAttribute("id");

		console.log(id);

		var list = new List(id, {
			valueNames: ["name"],
		});

		console.log(list?.items);

		[...list?.items].map((item) => {
			let species = [];

			[...item.elm.querySelectorAll(".species span")].map(
				(speciesElm) => {
					species.push(speciesElm.getAttribute("data-term"));
				}
			);

			item.values({
				species: species,
			});
		});

		const speciesFilter = block.querySelector(".species-filter");

		speciesFilter
			.querySelector("button")
			.addEventListener("click", (event) => {
				event.preventDefault();

				if (speciesFilter.classList.includes("active")) {
					speciesFilter.classList.remove("active");
				} else {
					speciesFilter.classList.add("active");
				}
			});

		[...speciesFilter.querySelectorAll("a")].map((filter) => {
			filter.addEventListener("click", (event) => {
				event.preventDefault();

				if (event.target.classList.contains("active")) {
					event.target.classList.remove("active");
					list.filter();
				} else {
					[...speciesFilter.querySelectorAll("a")].map((f) => {
						f.classList.remove("active");
					});

					event.target.classList.add("active");

					list.filter(function (i) {
						if (
							i
								.values()
								.species.includes(
									event.target.getAttribute("data-term")
								)
						) {
							return true;
						} else {
							return false;
						}
					});
				}
			});
		});
	});
}
