function imageScrollerInit() 
{
	const blocks = document.querySelectorAll('.odin-image-scroller');

	[...blocks].map(block => {

		const swiperEl = block.querySelector('swiper-container');

		Object.assign(swiperEl, {
			freeMode: {
				enabled: true,
				sticky: true,
			},
            // mousewheel: {
            //   sensitivity: 1
            // },
			autoplay: {
				delay: 1500
			},
			slidesPerView: 2.3,
			spaceBetween: 5,
			loop: true,
			grabCursor: true,
			breakpoints: {
				640: {
					slidesPerView: 4.5,
					spaceBetween: 15,
				}
			}
		});

		swiperEl.initialize();

		// SET SPACERS
		setTimeout(() => imageScrollerSetHeights(block, swiperEl), 300);

		// WATCH SPACERS
		window.addEventListener('resize', () => {
			imageScrollerSetHeights(block, swiperEl);
		});
	});
}

function imageScrollerSetHeights(block, swiperEl) 
{
	// ONLY OVERLAP GALLERY
	if ( block.classList.contains('odin-overlap') ) {
			
		// GET GALLERY HEIGHT
		const height = swiperEl.offsetHeight;

		// GET SIBLING GROUPS
		const groupPrevious = block.previousElementSibling;
		const groupNext = block.nextElementSibling;

		// REMOVE EXISTING SPACERS
		[...groupPrevious.querySelectorAll('.group-spacer')].map(elm => elm.remove());
		[...groupNext.querySelectorAll('.group-spacer')].map(elm => elm.remove());

		// GENERATE NEW SPACERS
		const spacerPrevious = document.createElement('div');
			spacerPrevious.classList.add('group-spacer');
			spacerPrevious.style.height = height / 2 + 'px';

		const spacerNext = document.createElement('div');
			spacerNext.classList.add('group-spacer');
			spacerNext.style.height = height / 2 + 'px';

		// PLACE SPACERS IN SIBLING BLOCKS
		if ( groupPrevious.classList.contains('odin-group') ) {
			groupPrevious.appendChild(spacerPrevious);
		}

		if ( groupNext.classList.contains('odin-group') ) {
			groupNext.prepend(spacerNext);
		}
	}
}

document.addEventListener('DOMContentLoaded', imageScrollerInit);
function mediaInit() 
{
	const mediaBlocks = document.querySelectorAll('.odin-media');

	[...mediaBlocks].map(block => {

		// VIDEO BLOCK
		if ( block.classList.contains('odin-media-video') ) {

			const video = block.querySelector('video');
			const play_button = block.querySelector('button.play');

			play_button.addEventListener('click', () => {
				video.play();
				play_button.style.display = 'none';
			});

			video.addEventListener('click', () => {
				video.pause();
				play_button.style.display = 'block';
			})
		}


		// GALLERY BLOCK
		if ( block.classList.contains('odin-media-image-gallery') ) {

			const swiperEl = block.querySelector('swiper-container');

			Object.assign(swiperEl, {
				slidesPerView: 1,
				loop: true,
				grabCursor: true,
				navigation: {
					enabled: true,
					nextEl: '.swiper-button-next',
					prevEl: '.swiper-button-prev',
				}
			});

			swiperEl.initialize();
		}
	});
}

document.addEventListener('DOMContentLoaded', mediaInit);
