const menuOpenButton = document.getElementById("menu-open");
const menuCloseButton = document.getElementById("menu-close");
const headerLogo = document.querySelector("header#site-header .logo");
const menuLogo = document.querySelector("#menu-panel .logo");
const menuPanel = document.getElementById("menu-panel");

const setMenuClosePosition = () => {
  let menuOpenRect = menuOpenButton.getBoundingClientRect();
  menuCloseButton.style.top = menuOpenRect.top + "px";
  menuCloseButton.style.left = menuOpenRect.left + "px";

  let headerLogoRect = headerLogo.getBoundingClientRect();
  menuLogo.style.top = headerLogoRect.top + "px";
  menuLogo.style.left = headerLogoRect.left + "px";
};

document.addEventListener("DOMContentLoaded", setMenuClosePosition);
window.addEventListener("resize", setMenuClosePosition);

////////////////////////////
// MENU OPEN/CLOSE EVENTS //
////////////////////////////
const openMenuPanel = (e) => {
  e.preventDefault();

  // SCROLL TOP
  gsap.set(window, { scrollTo: 0 });

  setTimeout(function () {
    // DISABLE BODY SCROLLING
    document.body.style.overflow = "hidden";

    // POSITION CLOSE & LOGO
    setMenuClosePosition();

    // SET STAGE
    const tl = gsap
      .timeline({ defaults: gsapDefaults })
      .set("#menu-panel", { background: "rgba(88, 167, 70, 0)" })
      .set("#menu-panel .menu-background", {
        yPercent: 20,
        rotate: "-5deg",
        scale: 0.9,
        opacity: 0,
      })
      .set("#menu-panel .wiggle", { yPercent: 100, scaleY: -1 })
      .call(() => {
        setMenuClosePosition();

        // OPEN MENU
        menuPanel.classList.add("active");
      });

    // ANIMATE
    tl.to(
      "#menu-panel",
      { background: "rgba(88, 167, 70, .9)", duration: 0.4 },
      0
    )
      .to(
        "#menu-panel .menu-background",
        { yPercent: 0, rotate: "0deg", scale: 1, opacity: 1 },
        0
      )
      .to("#menu-panel .wiggle-1", { yPercent: 0, duration: 0.75 }, 0)
      .to("#menu-panel .wiggle-2", { yPercent: 0 }, 0);
  }, 300);
};

const closeMenuPanel = (e) => {
  e.preventDefault();

  const tl = gsap
    .timeline({
      defaults: gsapDefaults,
      onComplete: () => {
        // CLOSE MENU
        menuPanel.classList.remove("active");

        // ENABLE BODY SCROLLING
        document.body.style.overflow = null;

        // REMOVE INLINE STYLES
        gsap.set("#menu-panel .menu-inner", { yPercent: 0 });
      },
    })
    .to(menuPanel, { scrollTo: 0, duration: 0.4 }, 0)
    .to("#menu-panel .wiggle-1", { yPercent: 100, duration: 0.75 }, 0.4)
    .to("#menu-panel .wiggle-2", { yPercent: 100 }, 0.4)
    .to("#menu-panel", { background: "rgba(88, 167, 70, 0)", duration: 1 }, 0.4)
    .to("#menu-panel .menu-inner", { yPercent: 200, duration: 1 }, 0.4);
};

menuOpenButton.addEventListener("click", openMenuPanel);
menuCloseButton.addEventListener("click", closeMenuPanel);

